import React, { Component, useState } from 'react';
import { FormControl, FormLabel, FormHelperText, Input, InputLabel, makeStyles, TextField, Button } from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        '& > *': {
            margin: theme.spacing(1),
        },
    },
}));

function NewShowForm(props){
    const classes = useStyles();

    const [newShow, setShow] = useState({
        comedian_id: 5,
        date: "",
        is_virtual: false,
        venue: "",
        address: "",
        phone_number: "",
        ticket_link: "",
        venue_website: "",
        ticket_price: 0
    })

    const changeHandler = (e) => {
        const { name, value } = e.target
        setShow({ ...newShow, [name]: value })
    }


    console.log("new show form props", props)
    return(
        <>
            <h2>New Show From</h2>
            <FormControl>
                <form className={classes.root} noValidate autoComplete="off" onSubmit={signupHandler}>
                    <TextField id="standard-basic" name="date" label="Name" value={newShow.name} onChange={changeHandler} />
                    <TextField id="standard-basic" name="email" label="Email" value={newShow.email} onChange={changeHandler} />
                    <TextField id="standard-basic" name="password" label="Password" value={newShow.password} onChange={changeHandler} />
                    <TextField id="standard-basic" name="website" label="Website" value={newShow.website} onChange={changeHandler} />
                    <TextField id="standard-basic" name="headshot_link" label="Link to Headshot" value={newShow.headshot_link} onChange={changeHandler} />
                    <TextField id="standard-basic" name="city" label="City" value={newShow.city} onChange={changeHandler} />
                    <TextField id="standard-basic" name="genre" label="Genre" value={newShow.genre} onChange={changeHandler} />
                    <Button type="submit">Submit</Button>
                    {/* <TextField id="filled-basic" label="Filled" variant="filled" />
                <TextField id="outlined-basic" label="Outlined" variant="outlined" /> */}
                </form>
            </FormControl>
        </>
    )
}

export default NewShowForm
